import {Switch, Route } from 'react-router-dom';
import React from 'react'
import Meals from './Meals'
import Nav from './Nav'
import About  from './About'




const Main = () => (
    <Switch>
      <Route exact path='/' component={Meals}></Route>
      <Route exact path='/about' component={About}></Route>
    </Switch>
  );
export default Main;
